package jcurry.util.function.testdata;

public final class UnaryOperators {

    private UnaryOperators() {}

    public static Integer addOne(Integer v) {
        return v + 1;
    }

    public static double addOne(double v) {
        return v + 1;
    }

    public static int addOne(int v) {
        return v + 1;
    }

    public static long addOne(long v) {
        return v + 1;
    }

}
